import React, { Component, Fragment } from 'react';
import TextField from '@material-ui/core/TextField';
import TableComponent from "../table/table";


class Search extends Component {

    state = { };

    render() {

        return (
            <Fragment>
                <TextField
                    margin={"normal"}
                    id="outlined-number"
                    label="limit"
                    type="number"
                    InputLabelProps={{
                        shrink: true,
                    }}
                    variant="outlined"
                    
                />
                <TextField
                    margin={"normal"}
                    id="outlined-number"
                    label="Search"
                    type="text"
                    InputLabelProps={{
                        shrink: true,
                    }}
                    variant="outlined"
                />
                <TableComponent list={[]}/>
            </Fragment>
        );
    }

}

export default Search;
